import React from 'react';
import Card from './Card';

const Cardlist = ({robots}) => {
	const cardArray = robots.map((user,i, id) => {
		return <Card 
		key={id} 
		id={robots[i].id} 
		name={robots[i].name} 
		username={robots[i].username} 
		email={robots[i].email}/>
	})
	return(
		<div>
			{cardArray}
		</div>
	);
}

export default Cardlist;
